import axios from "axios";
import { FastField } from "formik";
import React from "react";
import { useState } from "react";
import { Inputs } from "./Inputs_auth";

export const SwitchRememberMe = ({ label, name }) => {
  const [modifySwitch, setModifySwitch] = useState(0); // 0=off * 1=on
  const [inputStack] = Inputs();
  const remember = () => {
    if (modifySwitch == 0) {
      setModifySwitch(1);
      console.log("be on");
      const inputs_value = {
        phone: inputStack,
        password: "edfe",
      };
      console.log(inputs_value.phone);
    } else {
      setModifySwitch(0);
      console.log("be off");
    }
  };

  return (
    <div onClick={remember} className="form-check form-switch pt-4">
      <FastField
        className="form-check-input pointer"
        type="checkbox"
        name={name}
      />
      <label className="form-check-label">{label}</label>
    </div>
  );
};

